function PopupWithForm(name, title, isOpen, onClose, children) {
    return(
        <section className={props.isOpen ? `popup popup_opened popup_${props.name}` : `popup_${props.name} popup`}>
          <div className="popup__container">
            <button className="popup__close-btn" onClick={props.onClose}/>
            <form className={`popup__form-${props.name} popup__form popup__content`}>
              <h2 className={`${props.name}__title`}>{props.title}</h2>
              {props.children}
            </form>
          </div>
        </section>
    )
}

export default PopupWithForm
